import React, { Component,useState } from 'react';
import './towns.css';
const Towns=()=>{
    const [name, setname] = useState()
const nametown=(text)=>{
    setname(text)
}
    return(
        <div>
        <button onClick={()=>nametown('ایلام')} className="townbutton">ایلام</button>
        <button onClick={()=>nametown('تهران')} className="townbutton">تهران</button>
        <button onClick={()=>nametown('اهواز')} className="townbutton">kkk</button>
        <button onClick={()=>nametown('بوشهر')} className="townbutton">kkk</button>
        </div>
    )
}
export default Towns;
